import Navbar from "./components/Navbar.js"
import Dashboard from './components/Dashboard'

function App() {
  let isLoggedIn = true;

  if (isLoggedIn == false){
    return(
      <>
        <div className="container">
          <Navbar />
          <h2>Landing Page</h2>
        </div>

      </>
    )
  }
  else {
    return <Dashboard name="Tyler"/>
  }
}

export default App;
